Artemiy Anrilov was born in 1977 in the most north city of Russia - Murmansk.&#13;
His interest in electronic music has arrived with acquiring&#13;
good-old-fashioned ZX-Spectrum computer, which one Artem used to&#13;
produce some primitive and weird sounds instead of playing primitive&#13;
games.&#13;
&#13;
After ZX-Spectrum he has got more serious computer gear it was PC AT&#13;
386 and started to conquer different "trackers" such as Scream&#13;
Tracker, Impulse Tracker etc.&#13;
&#13;
Idea to start dj career has come in mind in 1996 year, so it has been started.&#13;
Began to play house / acid house, during 2-3 years through different&#13;
styles and sounds Artem has come to techno / minimal sound which&#13;
became main nowadays.&#13;
&#13;
After moving to Moscow in 2002, Artem continues to develop his musical&#13;
tastes and horizons.&#13;
In 2005 he meets people who are stands behind DeepMix Moscow Radio and&#13;
participates in developing radiostation.&#13;
In 2006 in collaboration with his friends from Murmansk, San-Francisco&#13;
and Moscow launches internet label "Fragment" which was mainly aimed&#13;
to release russian minimal / techno electronic music.&#13;
&#13;
During last 3 years played in many russian and former USSR cities. Was&#13;
residient of legendary club "Mix". Recently played in "Solyanka" Club.&#13;
Nowadays Artem resident of RTS.FM internet radio, clubs: "Arma 17",&#13;
"Shanti, "Propaganda". Also he is with Vasiliy Bvoice organizer of monthly&#13;
"Fragment Sessions" parties that takes place in club Shanty every&#13;
pre-last thursday of month.&#13;
&#13;
Taking part in project "B.A.D." with Vasily BVoice and Alex Danilov.
